def primes_up_to(n):
    """"""
    sieve = [True] * (n + 1)
    sieve[0] = sieve[1] = False
    p = 2
    while p ** 2 <= n:
        if sieve[p]:
            for i in range(p ** 2, n + 1, p):
                sieve[i] = False
        p += 1
    return [i for (i, is_prime) in enumerate(sieve) if is_prime]
